import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

// IMPORTS CRÍTICOS - Verifique se os nomes batem EXATAMENTE com suas pastas
import Home from './Pages/Home';       // Pasta Pages (Maiúsculo)
import Cadastro from './Pages/Cadastro'; // Pasta Pages (Maiúsculo)

function App() {
  return (
    <BrowserRouter>
      <nav style={{ background: '#333', padding: '10px', color: '#fff', marginBottom: '20px' }}>
        <Link to="/" style={{ color: '#fff', marginRight: '10px' }}>Home</Link>
        <Link to="/cadastro" style={{ color: '#fff' }}>Cadastro</Link>
      </nav>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/cadastro" element={<Cadastro />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
